import React from "react";
import Card from "./Card";
import Sdata from "./Service-data";


const Service =()=>{
    return(
        <>
        <div className="service">
  <h1>Our Services</h1>
  </div>
         {Sdata.map((val , index , array) => {
            return(
                <Card
                key = {val.id}
                imgsrc = {val.imgsrc}
                heading = {val.heading}
                para = {val.para}
                />
            )
        })} 
    </>
    )
}
export default Service;
